import React from 'react'  
class About extends React.Component {  
  render() {  
    return (
      <div>
          <h1>About</h1>
          <p>
          Concept Solutions is a Software Development and Training company that offers custom software development services on diverse technology platforms, like Microsoft, Java, PHP and Mobile. With rich and wide range of experience of 13 years in software development and uncompromising quality standards, we offer utmost qualitative, on-time and cost-effective software solutions.
        </p>
       </div>
      )  
  }  
}  
export default About
